import ExpensiveItem from "./components/ExpenseItem";

function App() {
  // const a= document.createElement('p');
  // a.textContent='aloooohhtr';
  // document.getElementById('root').append(a);
  const expenses = [
    {
      title: "alo1",
      amount: 13123,
      date: new Date(),
    },
    {
      title: "alo2",
      amount: 32323232,
      date: new Date(),
    },
    {
      title: "alo3",
      amount: 3434343,
      date: new Date(),
    },
    {
      title: "alo4",
      amount: 4545454,
      date: new Date(),
    },
  ];

  return (
    <div>
      {/* <h2>Let's get started!</h2> */}
      <ExpensiveItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpensiveItem>
      <ExpensiveItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpensiveItem>
      <ExpensiveItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpensiveItem>
      <ExpensiveItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      ></ExpensiveItem>
    </div>
  );
}

export default App;
